import React, { Component } from "react";
import NewsItems from "./NewsItems";

export class News extends Component {
  articles = [
    {
      source: {
        id: "abc-news",
        name: "ABC News",
      },
      author: "YURI KAGEYAMA AP Business Writer",
      title:
        "Profit at Japan's Honda doubles on healthy global auto and motorcycle sales",
      description:
        "Honda says its April-June profit more than doubled on healthy sales of its motorcycles and cars, as the Japanese company also received a perk from favorable exchange rates",
      url: "https://abcnews.go.com/Business/wireStory/profit-japans-honda-doubles-healthy-global-auto-motorcycle-102126032",
      urlToImage:
        "https://s.abcnews.com/images/US/abc_news_default_2000x2000_update_16x9_992.jpg",
      publishedAt: "2023-08-09T09:35:45Z",
      content:
        "TOKYO -- Honda reported Wednesday that its April-June profit more than doubled on healthy sales of its motorcycles and cars, as the Japanese company also received a perk from favorable exchange rates… [+2199 chars]",
    },
    {
      source: {
        id: null,
        name: "Notebookcheck.net",
      },
      author: "Daniel Zlatev",
      title:
        "Tesla battery supply analysis reveals why it warned about losing EV tax credit",
      description:
        "Elon Musk can't shake Tesla's Chinese battery dependency any time soon, it seems, according to a new supply chain analysis. Tesla warned that in 2024 its bestselling vehicles may lose some of the tax credit they are now eligible for.",
      url: "https://www.notebookcheck.net/Tesla-battery-supply-analysis-reveals-why-it-warned-about-losing-EV-tax-credit.739809.0.html",
      urlToImage:
        "https://www.notebookcheck.net/fileadmin/Notebooks/News/_nc3/Tesla_Lithium_Groundbreaking_00-1_8.jpg",
      publishedAt: "2023-08-09T09:12:00Z",
      content:
        "Tesla recently warned that the US$7,500 new EV tax credit it now receives from the US government towards the purchase of one of its bestselling Model Y and Model 3 vehicles may be reduced next year. … [+2099 chars]",
    },
    {
      source: {
        id: null,
        name: "SoyaCincau.com",
      },
      author: "Chief Chapree",
      title:
        "Booked a Tesla Model Y in Malaysia? You may need to pay extra delivery fees if you’re outside the Klang Valley",
      description:
        "Future owners of Tesla Model Y in Malaysia may have to make additional arrangements once Tesla is ready to hand over the EV to them early next year. This is based on our conversations with several sources close to the matter. At the moment, Tesla has yet to r…",
      url: "https://soyacincau.com/2023/08/09/tesla-modely-malaysia-extra-delivery-fee/",
      urlToImage:
        "https://soyacincau.com/wp-content/uploads/2023/08/tesla-modely-pavkl01.jpg",
      publishedAt: "2023-08-09T09:07:52Z",
      content:
        "Future owners of Tesla Model Y in Malaysia may have to make additional arrangements once Tesla is ready to hand over the EV to them early next year. This is based on our conversations with several so… [+3207 chars]",
    },
    {
      source: {
        id: "independent",
        name: "Independent",
      },
      author: "Ellie Muir",
      title:
        "Elon Musk gave Grimes a ‘trivia test’ on Lord of the Rings when they first started dating",
      description:
        "The SpaceX founder took the ‘Genesis’ singer to the Tesla factory in Fremont for one of their first dates",
      url: "https://www.independent.co.uk/life-style/love-sex/elon-musk-grimes-lord-of-the-rings-trivia-test-b2390046.html",
      urlToImage:
        "https://static.independent.co.uk/2023/08/09/09/newFile.jpg?quality=75&width=1200&auto=webp",
      publishedAt: "2023-08-09T08:30:48Z",
      content:
        "Stay ahead of the trend in fashion and beyond with our free weekly Lifestyle Edit newsletter\r\nStay ahead of the trend in fashion and beyond with our free weekly Lifestyle Edit newsletter \r\nElon Musk … [+2712 chars]",
    }
  ];
  constructor() {
    super();
    console.log("This is my Constructor.");

    this.state = {
      articles: this.articles,
      loading: false,
    };
  }
  async componentDidMount(){
    let url = "https://newsapi.org/v2/top-headlines?country=in&apiKey=43596fac69da4e19bd989984ab1f1dfd";
    let data = await fetch(url);
    let parsedData = await data.json();
    // console.log(parsedData);
    this.setState({articles: parsedData.articles});
  }
  render() {
   
    return (
      <div className="container my-3">
        <h3>NewsMonkey - headlines</h3>

        <div>
          <div className="row">
            {this.state.articles.map((element) => {
              return(
            <div className="col-md-3" key={element.url}>
              <NewsItems
                title={element.title?element.title.slice(0, 75): " "}
                description={element.description?element.description.slice(0, 90): " "}
                imgUrl={element.urlToImage}
                newsUrl={element.url}
              />
            </div>
              )
              
            })}
          </div>
        </div>
      </div>
    );
  }
}

export default News;
